import React from "react";

const Menubutton = ({ complitedButton, activeButton }) => {
  return (
    <div className="optionButton">
      <ul>
        <li>
          <a href="#/" onClick={() => {}}>
            All
          </a>
        </li>
        <li
          onClick={() => {
            activeButton();
          }}
        >
          <a href="#/Active">Active</a>
        </li>
        <li
          onClick={() => {
            complitedButton();
          }}
        >
          <a href="#/Complited">Complited</a>
        </li>
      </ul>
    </div>
  );
};
export default Menubutton;
